import React from 'react';

import {HomePageController} from './ItemsByCategoryPageController';
import {
    DivMainContainer,
    DivFloat,Header,ListItemRow
}
    from './ItemsByCategoryPageElement';

    import {DefaultColor} from '../../components/config';

import {ListItemSmall} from '../../components/Items';

class ItemsByCategoryPage extends HomePageController {
    constructor(props){
        super(props);

    }

    render() {

        let latestArticlesData = chunkArray(this.state.latestArticles,3);
        let latestArticlesElements = latestArticlesData.map((element,index)=>{
            return (<ListItemRow key={"key"+index}>
                    {
                        element.map((elm,i)=>{
                            return (<ListItemSmall item={elm} key={"listiemsmall"+i} />)
                        })
                    }
                </ListItemRow>);
        });

        return (
            <DivMainContainer>

               <Header >



                                <DivFloat 
                                    flexDirection="column" 
                                    justifyContent="flex-end" 
                                    alignItems="flex-start" 
                                    width="80%" 
                                >
                                    <br/><br/>
                                    <div
                                    style={{color:DefaultColor,fontSize:30,fontFamily:"Dancing Script"}}
                                    >
                                        AWS Tutorials<br/>
                                    </div>

                                    <div 
                                    style={{color:DefaultColor,marginTop:5,fontSize:25,fontFamily:"Darker Grotesque"}}
                                    >
                                           As we know AWS is short form of Amazon Web Service that is the subsidiary of Amazon providing on-demand cloud computing platforms to individuals and companies as well as governments.<br/>
   In this category, I would share my real  life aws experiences.
                                    </div><br/>
                                </DivFloat>
                </Header>
                <DivFloat  
                                flexDirection="column" 
                                justifyContent="flex-start" 
                                alignItems="flex-start" 
                                width="80%" 
                            >
                               {latestArticlesElements}

                </DivFloat>

            </DivMainContainer>
        );
    }
}



export {ItemsByCategoryPage};
